def rag():

    def gerar_documento_cliente(cliente: dict) -> str:
        partes = []

        for chave, valor in cliente.items():
            # Se o valor for uma string que parece uma lista JSON
            if isinstance(valor, str) and valor.startswith("[") and valor.endswith("]"):
                try:
                    itens = json.loads(valor)
                    if isinstance(itens, list):
                        for item in itens:
                            partes.append(f"{chave}: {item}")
                except:
                    partes.append(f"{chave}: {valor}")
            else:
                partes.append(f"{chave}: {valor}")
        
        return {cliente["title"]: "\n".join(partes)}

